<script lang="ts">
import { onMount } from 'svelte';

export let size = 400;

let dotsGroup: SVGGElement | null = null;
let eyesElement: SVGUseElement | null = null;

onMount(() => {
  // Configuration - scale from 800pt design
  const scale = size / 800;
  const numDots = 110;
  const radius = 394 * scale;
  const dotRadius = 5 * scale;
  const dotColor = '#cb5839';

  if (dotsGroup) {
    for (let i = 0; i < numDots; i++) {
      const angle = (i * 2 * Math.PI) / numDots;
      const circle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');

      circle.setAttribute('cx', (radius * Math.cos(angle)).toFixed(2));
      circle.setAttribute('cy', (radius * Math.sin(angle)).toFixed(2));
      circle.setAttribute('r', dotRadius.toString());
      circle.setAttribute('fill', dotColor);

      // eslint-disable-next-line svelte/no-dom-manipulating
      dotsGroup.appendChild(circle);
    }
  }

  function blink(): void {
    if (eyesElement) {
      eyesElement.style.transition = 'opacity 0.05s ease-in';
      eyesElement.style.opacity = '1';

      setTimeout(() => {
        if (eyesElement) {
          eyesElement.style.transition = 'opacity 0.15s ease-out';
          eyesElement.style.opacity = '0';
        }
      }, 80);

      // eslint-disable-next-line sonarjs/pseudo-random
      setTimeout(blink, 500 + Math.random() * 2000);
    }
  }

  // eslint-disable-next-line sonarjs/pseudo-random
  setTimeout(blink, 1500 + Math.random() * 1000);
});
</script>

<svg width={size} height={size} viewBox="0 0 {size} {size}"
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink" color-interpolation-filters="sRGB"
    aria-hidden="true"
    role="img"
    style="--center: {size / 2}px; --float-x: {size * 40 / 800}px; --float-y: {size * -20 / 800}px;">
    <style>
        @keyframes rotateDots {
            to { transform: translate(var(--center), var(--center)) scale(0.7) rotate(360deg); }
        }

        @keyframes floatHead {
            50% { transform: translate(var(--float-x), var(--float-y)); }
        }

        @keyframes fadeShadow1 {
            50% { opacity: 0.0; }
        }

        @keyframes fadeShadow2 {
            50% { opacity: 0.5; }
        }

        #dots {
            animation: rotateDots 40s linear infinite;
            transform-origin: 0 0;
        }

        #headGroup {
            animation: floatHead 4s ease-in-out infinite;
        }

        #shadow1Element {
            animation: fadeShadow1 4s ease-in-out infinite reverse;
            opacity: 0.5;
        }

        #shadow2Element {
            animation: fadeShadow2 4s ease-in-out infinite;
            opacity: 0;
        }
    </style>
    <defs>
        <clipPath id="backgroundClip">
            <circle cx={size / 2} cy={size / 2} r={size * 295 / 800}/>
        </clipPath>

        <image id="shadow1" xlink:href="data:image/png;base64," width="{size}" height="{size}"/>
        <image id="shadow2" xlink:href="data:image/png;base64," width="{size}" height="{size}"/>
        <image id="head" xlink:href="data:image/png;base64," width="{size}" height="{size}"/>
        <image id="eyes" xlink:href="data:image/png;base64," width="{size}" height="{size}"/>
    </defs>

    <circle cx={size / 2} cy={size / 2} r={size * 295 / 800} fill="#962f2f" stroke="none"/>

    <g id="dots" bind:this={dotsGroup} transform="translate({size / 2}, {size / 2}) scale(0.7)"></g>

    <g clip-path="url(#backgroundClip)">
        <use id="shadow1Element" xlink:href="#shadow1" style="mix-blend-mode: soft-light;"/>
        <use id="shadow2Element" xlink:href="#shadow2" style="mix-blend-mode: soft-light;"/>
    </g>

    <g id="headGroup">
        <use xlink:href="#head"/>
        <use id="eyesElement" bind:this={eyesElement} xlink:href="#eyes" style="opacity: 0;"/>
    </g>
</svg>
